const Shoplist = () => {
  return (
    <div>
      <h1>Shop List</h1>
      <ul>
        <li>Item 1</li>
        <li>Item 2</li>
        <li>Item 3</li>
      </ul>
    </div>
  );
};

export default Shoplist;
